import React from "react";
import s from "./style.module.scss";
import Image from "../image/img";
import Text from "../Text/text";

export default function Card({
  src,
  width,
  height,
  alt,
  text1,
  text3,
  text2,
  color,
  uppercase,
  fsize,
  fweight,
  align,
  fontFamily,
}) {
  return (
    <div className={s.card}>
      <Image
        src={`${src}`}
        style={{ width: width, height: height }}
        alt={`${alt}`}
      />
      <Text
        text={`${text1}`}
        style={{
          color: color,
          textTransform: uppercase,
          fontSize: fsize,
          fontWeight: fweight,
          textAlign: align,
          width: `${width}%`,
          fontFamily: `${
            fsize > 20
              ? `'Poppins', sans-serif`
              : `'Libre Franklin', sans-serif`
          }`,
        }}
      />
      <Text
        text={`${text2}`}
        style={{
          color: color,
          textTransform: uppercase,
          fontSize: fsize,
          fontWeight: fweight,
          textAlign: align,
          width: `${width}%`,
          fontFamily: `${
            fsize > 20
              ? `'Poppins', sans-serif`
              : `'Libre Franklin', sans-serif`
          }`,
        }}
      />
      <Text
        text={`${text3}`}
        style={{
          color: color,
          textTransform: uppercase,
          fontSize: fsize,
          fontWeight: fweight,
          textAlign: align,
          width: `${width}%`,
          fontFamily: `${
            fsize > 20
              ? `'Poppins', sans-serif`
              : `'Libre Franklin', sans-serif`
          }`,
        }}
      />
    </div>
  );
}
